package com.kuaixiu.videoUserRel.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-08-15 下午03:39:20 * @version: V 1.0 */public class VideoUserRel extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * 主键     */    private Long id ;    /**     * 手机号     */    private String mobile ;    /**     * 卡密id     */    private String cardId ;    /**     * 对应订单号     */    private String orderNo ;    /**     * 创建时间     */    private java.util.Date createTime ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public String getMobile(){        return this.mobile;    }    public void setMobile(String mobile){        this.mobile=mobile;    }    public String getCardId(){        return this.cardId;    }    public void setCardId(String cardId){        this.cardId=cardId;    }    public String getOrderNo(){        return this.orderNo;    }    public void setOrderNo(String orderNo){        this.orderNo=orderNo;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }}